import React, { Component } from 'react'
import './Tag.css'

class Tag extends Component {
    tag = () => {
        {
            this.props.tags.map((tag) => {
                const name = " " + tag.name
                return (
                    <li classNAme="tags">
                        <a className="tag-link" href={"/tags/" + tag.id} key={tag.id}>
                            {name}
                        </a>
                    </li>
                );
            })
        }
    }

    render() {
        return (
            <this.tag />
        )
    }
}

export default Tag
